import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles((theme) => ({
  root: {paddingTop: '2%'},
  upcomingBestRoot: {paddingTop: '2%'},
  upcomingBestCard: {},
  title: {
    textAlign: 'center',
  },
  subtitle: {
    textAlign: 'left',
    paddingLeft: '2.5%'
  }
}));
